jQuery.clss("models.users",{viewModel:{users:ko.observableArray(),user:ko.mapping.fromJS({username:"",fullname:"",email:"",type:"user"})},_constructor:function(){$.models.users.init()},init:function(){},_isUser:function(a){var b=!1;return $.each(this.viewModel.users(),function(){this.username==a.username&&(b=!0)}),b},_resetUser:function(){this.viewModel.user.username(""),this.viewModel.user.fullname(""),this.viewModel.user.email("")},addUser:function(a){this._isUser(a)||(this.viewModel.users.push(a),this._resetUser())},deleteUser:function(a){this.viewModel.users.remove(function(b){return b.username==a.username})},getUser:function(){return ko.mapping.toJS(this.viewModel.user)}})();